import React from 'react';

import './App.css';
import HomePage from './pages/homepage/homepage.component';

import {Router} from 'react-router-dom';


function App() {
  return (
    <div >
     <HomePage/>
     <Router exact path='/' component={ HomePage}/>
     <Router exact path='/hats' component={HatsPage}/>
    </div>
  );
}

export default App;
